prototype.projection:
events.forEach((eventData)=>{
    let event = eventData.data
    switch(eventData.type) {

       	case 'QuestionAddedEvent':
			this.resultList.push({
			question:event.question,
			answer:event.answer,
			questionId:event.questionId,
			quizId:event.quizId
		})
    	return;

    }
})

